import React from "react";

import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div key="header">
      <div className="container">

          <Link to="/" className="btn btn-primary mr-1" key="homepage">
            Homepage
          </Link>

          <Link to="/authors" className="btn btn-primary ml-1" key="authors">
            Authors
          </Link>
      </div>
    </div>
  );
};

export default Navbar;
